import "./featured.css";

const Featured = () =>{
    return(
        <div className="featured">
            <div className="featuredItem">
                <img src="https://www.booking.com/hotel/ae/spacious-4-bd-apartment-with-amazing-sea-view-dubai.html?sid=27684f557c0b9daffcad2374f1e860da&aid=355028&ucfs=1&arphpl=1&dest_id=-782831&dest_type=city&group_adults=2&req_adults=2&no_rooms=1&group_children=0&req_children=0&hpos=1&hapos=1&sr_order=popularity&srpvid=bddc6e8e815d018f&srepoch=1653493406&from=searchresults#hotelTmpl" alt="" className="featuredImg" />
                <div className="featuredTitles">
                    <h1>Dublin</h1>
                    <h2>533 properties</h2>
                </div>
            </div>
        </div>
    );
}

export default Featured;
